class Board:
	# define the constructor for the class, which takes in several arguments
	def __init__(self, canvas, window, light_color, dark_color, border_color, hilight_color, square_size):
	    # set the canvas attribute to the canvas object passed in as an argument
	    self.canvas = canvas
	    
	    # set the light_color, dark_color, border_color, and hilight_color attributes to the corresponding arguments
	    self.light_color = light_color
	    self.dark_color = dark_color
	    self.border_color = border_color
	    self.hilight_color = hilight_color
	    
	    # set the square_size attribute to the square_size argument
	    self.square_size = square_size
	    
	    # set the prv_sq, turn, square, images, position, valid_moves, encoded_moves, piece_image, promoted, and game_moves attributes to their initial values
	    self.prv_sq = None
	    self.turn = 1
	    self.square = list()
	    self.images = list()
	    self.position = list()
	    self.valid_moves = dict()
	    self.encoded_moves = dict()
	    self.piece_image = {}
	    self.promoted = None
	    self.game_moves = list() 

	    # load the shared library chess-console.dll using the ctypes library
	    self.lib = ctypes.CDLL('chess-console.dll')    
	    # call the function 'initialise_attacks' from the shared library to initialize the attack patterns for each piece
	    self.lib.initialise_attacks()   
	    # set up the c2p dictionary to map chess pieces to piece images
	    self.c2p = { 1:2, 2:3, 3:4, 4:5, 7:-2, 8:-3, 9:-4, 10:-5 }
	    self.promoted      = None
	    self.game_moves    = list()


