	teal = ["#dee3e6", "#8ca2ad", "#4e636e"]
	brwn = ["#f0dab5", "#b58763", "#725036"]
	frst = ["#f0f6ef", "#7dc083", "#3e8044"]
	bllu = ["#dbe8f0", "#6d99c0", "#365c7e"]
	pnnk = ["#fbdeda", "#ee8c7f", "#c12d1a"]
	grry = ["#bfbfbf", "#fefefe", "#989898"]
	grrn = ["#feffe0", "#93ad6c", "#596c3c"]

	board = Board(canvas        = canvas,
				  window        = window,
				  light_color   = teal[0],
	 			  dark_color    = teal[1],
	 			  border_color  = teal[2],
	 			  hilight_color = "#eadf96",
	 		      square_size   = SQUARE_SIZE)

	canvas.bind ('<Button-1>', board.clickedSquare)
	window.bind ('<Key>', board.undoMove)
	canvas.pack()

	#board.draw('r3k2r/p1ppqpb1/bn2pnp1/3PN3/1p2P3/2N2Q1p/PPPBBPPP/R3K2R w KQkq - ')
	board.draw('rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1')
	
	# print the results of the perft_driver function from the shared library
	depth = 5
